/* eslint-disable no-unused-vars */
import React, { useState, useEffect } from 'react';
import { useSelector } from 'react-redux';
import Displayer from '../components/Displayer';
import Scandinavia from '../imgs/scandinavia.png';

function Locations() {
  const { locationsReducer } = useSelector((state) => state);
  const { locations } = locationsReducer;
  const [locationsDisplay, setLocationsDisplay] = useState(null);

  useEffect(() => {
    console.log(locations);
  });

  return (
    <div className="locations">
      <div className="head">
        <div className="head-left">
          <img src={Scandinavia} alt="continent" className="continent" />
        </div>
        <div className="head-right">
          <h4 className="title">Scandinavia</h4>
          <h6 className="views">6.958 views</h6>
        </div>
      </div>
      <Displayer />
    </div>
  );
}
export default Locations;
